export default function Donnees(valeur) {
    const [donnee10,setter10] = useState();

    useEffect(() => {
        fetch(`http://worldtimeapi.org/api/timezone/Europe/Paris`).then((response) => response.json()).then((data) => {
            setter10(data['utc_datetime'])
        });
    });

    return (
       <text> {donnee10} </text>
    );
}
